import React from 'react';
import UserNavbar from '../components/UserNavbar';  // Import the user navbar


function About() {
  return (
    <div>
      <UserNavbar />  {/* Same navbar as UserHomePage */}
      <div className="about">
        <h2>About BukSU Lost and Found System</h2>
        <p>This system allows students to find and return lost items at BukSU.</p>
      </div>
    </div>
  );
}

export default About;
